var tipuesearch = {"pages": [{'title': 'About', 'text': '\n', 'tags': '', 'url': 'About.html'}, {'title': '組員名單', 'text': 'Repository:\xa0 40823102 \xa0 Site:\xa0 40823102 \n Repository:\xa0 40823106 \xa0 Site:\xa0 40823106 \n Repository:\xa0 40823108 \xa0 Site:\xa0 40823108 \n Repository:\xa0 40823112 \xa0 Site:\xa0 40823112 \n Repository:\xa0 40823115 \xa0 Site:\xa0 40823115 \n Repository:\xa0 40823120 \xa0 Site:\xa0 40823120 \n Repository:\xa0 40823135 \xa0 Site:\xa0 40823135 \n Repository:\xa0 40823140 \xa0 Site:\xa0 40823140 \n Repository:\xa0 40823142 \xa0 Site:\xa0 40823142 \n Repository:\xa0 40823146 \xa0 Site:\xa0 40823146 \n Repository:\xa0 40823148 \xa0 Site:\xa0 40823148 \n Repository:\xa0 40823151 \xa0 Site:\xa0 40823151 \n', 'tags': '', 'url': '組員名單.html'}, {'title': '小組Meeting', 'text': '', 'tags': '', 'url': '小組Meeting.html'}, {'title': 'W10', 'text': '\n 討論後決定: \n \n \n \n \n', 'tags': '', 'url': 'W10.html'}, {'title': 'W11', 'text': '\n 經過一星期的測試與設計發現上週討論的議題無法繪出，所以重新討論新的議題 \n \n \n \n', 'tags': '', 'url': 'W11.html'}, {'title': 'W12', 'text': '\n 討論議題是否可行與設計草圖 \n 側視圖: \n \n \n 上視圖: \n \n \n \n \n', 'tags': '', 'url': 'W12.html'}, {'title': 'W13', 'text': '\n', 'tags': '', 'url': 'W13.html'}, {'title': 'CoppeliaSim', 'text': '', 'tags': '', 'url': 'CoppeliaSim.html'}, {'title': 'Simulation Setting 模擬設定', 'text': '\n Simulation passes per frame 每偵模擬次數: \xa0 刷新螢幕前，主角本已執行X次。 Pause when simulation time higher than [S] 模擬時間>S時暫停: \xa0 模擬時能在特定時間暫停。 Pause on script error 腳本錯誤暫停: \xa0 腳本發生錯誤時，模擬暫停。 Full screen at simulation start 模擬開始時全屏: \xa0 模擬已全屏方式呈現。 Reset scene to initial slate 場景重置為初始化狀態: \xa0 所有對象在模擬完後重置為其初始狀態。 Remove new objects 刪除新對象: \xa0 在模擬運行間添加的東西將在模擬結束後刪除。 \n', 'tags': '', 'url': 'Simulation Setting 模擬設定.html'}, {'title': 'Scene Object Properties', 'text': '', 'tags': '', 'url': 'Scene Object Properties.html'}, {'title': 'Shape', 'text': '\n Adjust color 調整顏色: \xa0 允許編輯形狀的顏色。 Show edges with angle [deg] 顯示邊緣角度: \xa0 以黑色顯示邊，顯示的邊取決於指定的角度。 Blackface culling 背面剔除: \xa0 當一個形狀有內面和外面，啟用時不會顯示內部面。 Wireframe 線框: \xa0 圖形顯示為線框。 Invert faces 反轉面: \xa0 內面變外面，相反的外面變內面，凸形則會變非凸形。 Adjust texture 調整紋理: \xa0 形狀與紋理相關聯時，將以帶紋理顯示 Clear texture (selection) 快速紋理(選擇): \xa0 將紋理貼圖應用於所選的形狀。能使對象變得更逼真。 Quick texture (selection) 清除紋理(選擇): \xa0 所選的形狀中刪除紋理。 View/modify geometry查看/修改幾何: \xa0 能調整選定形狀的網格的各種參數。 Show dynamic properties dialog 顯示動態屬性對話框 : \xa0 切換動態屬性對話框。 \n', 'tags': '', 'url': 'Shape.html'}, {'title': 'Common', 'text': '\n Selectable 可選擇: \xa0 表示是否可以在場景選擇對象 Invisible during selection 選擇期間不可見: \xa0 該對象在選擇過程中不可見 Ignored depth pass 深度過程忽略: \xa0 在深度渲染過程中忽略對象。 Ignored for view-fitting 忽略視圖調整: \xa0 調整視圖時，不會考慮選擇此項目的對象。 Cannot be deleted during simul. 模擬過程中不能刪除: \xa0 該對象在模擬過程中忽略刪除動作 Cannot be deleted 無法刪除: \xa0 該對象忽略刪除動作 EXtension string 擴展字符串: \xa0 描述附加對象屬性的字符串，主要由擴展插件使用。 Camera visibility layers 相機可見層: \xa0 每個對象都可以分配一個或多個可見層。 Can be seen by 可通過以下方式查看: \xa0 指定唯一能看到對向的相機或傳感器。 Collidable 可碰撞: \xa0 選定對象可碰撞對象的檢測功能。 Measurable 可測量: \xa0 選定對象可測量的最小距離計算功能。 Detectable 可檢查: \xa0 可檢測對象的接近傳感器檢測功能。 Renderable 可渲染: \xa0 可渲染對象的視覺傳感器檢測功能。 Object is model base 模型基礎: \xa0 指定對象是否充當模型的基底。 Object/model can transfer or accept DNA 對象/模型可轉移或接受DNA: \xa0 當為對象或模型啟用此功能時，將其與所有副本共享相同的標示符。 \n', 'tags': '', 'url': 'Common.html'}, {'title': 'Calculation Modules 模組計算', 'text': '', 'tags': '', 'url': 'Calculation Modules 模組計算.html'}, {'title': 'Collision 碰撞檢測', 'text': '\n Enable all collision detections 啟用所有碰撞檢測: \xa0啟用或關掉所有已標記碰撞對象的碰撞檢測 Add new collision object 添加新的碰撞對象: \xa0指定兩個物體進行碰撞檢測 Explicit handling 顯示處理: \xa0是否顯示處理所選的碰撞對象 Collider/Collodee color changes 碰撞更改碰撞器/體顏色: \xa0啟用或關閉碰撞器/體在碰撞期間的顏色改變 Calc. coll. cont. (shapes only) 計算線圈、輪廓(僅限形狀): \xa0啟用則將對碰撞物體執行詳盡的碰撞檢測 Adjust contour color 調整輪廓顏色: \xa0可調整碰撞輪廓線的顏色 Contour widh [pt] 輪廓寬度: \xa0 調整碰撞輪廓線的寬度 \n', 'tags': '', 'url': 'Collision 碰撞檢測.html'}, {'title': 'Distance 距離', 'text': '\n Enable distance calculations 啟用距離計算: \xa0 啟用或關掉所有已標註對象的距離計算。 Add new distance object 增加新的距離對象: \xa0 指定兩個實體進行距離計算。 Use threshold [使用門檻]: \xa0 當實體相對距離很遠不須計算時，可指定數值來加快計算速度。 Display dist. segment顯示距離段: \xa0 距離對象的最小距離段變得可見。 \n \n', 'tags': '', 'url': 'Distance 距離.html'}, {'title': 'Rigid Body Dynamic Properties 剛體動力特性', 'text': '利用 設定 Local respondable mask、Global\xa0respondable mask \xa0 讓物體與物體之間產生交集，使其相互作用。 \n \n', 'tags': '', 'url': 'Rigid Body Dynamic Properties 剛體動力特性.html'}]};